import React from "react";
import "../styles/Footer.css";
import DecorationFooter from "../images/chirimbolos-footer.png";

const Footer = () => {
  return (
    <div>
      <div className="footer-container">
        <div className="footer-info">
          <p>Lenaria Web Design & Development</p>
        </div>
        <button type="button" className="footer-button">
          Contacto
        </button>
        <img className="decoration-footer" src={DecorationFooter} />
      </div>
    </div>
  );
};

export default Footer;
